# word rules:
# a word must not use the same side twice in a row
# must be atleast 3 letters long
# must start with the last letter of the previous word unless it is the first word

# game rules:
# the first word can start with any letter
# must use all the letters on the board

# game ends when player has used all the letters on the board
# player aims to use the fewest words possible

# we have 4 sets of 3 letters, one for each side of the box
# when we use a letter from one set we can't use it again until we have used a letter from another set
# letters must make a word from the valid word text file

# we need to create a function that will take the letters from the box
# and return a list of words that can be made from those letters

# function that reads the txt and returns a list of words that can be spelled with our letters

def wordFinder(chars):
    f = open("validWords.txt")
    spellable_words = []
    for line in f:
        word = line.strip()
        if any(c not in chars for c in word):
            continue
        spellable_words.append(word)

    return spellable_words


def letterFinder(letter, list_of_lists_of_letters):
    in_lists = []
    for w in list_of_lists_of_letters:
        if letter in w:
            in_lists.append(w)
    return in_lists


# takes a word and the list of available letters
# returns the word if it can be spelled without using the same side twice in a row
def validFinder(w, list_of_lists_of_letters):
    prev_lists = []

    for index, c in enumerate(w):
        # if first letter, we want to assign the prev_list to it then skip to the next iteration,
        # 1. we have no words with fewer than 3 letters, so no need to check if the word is valid yet
        # 2. we need a prev_list to check if the current list matches
        if index == 0:
            # set the prev list to it
            prev_lists = letterFinder(c, list_of_lists_of_letters)
            continue
        curr_lists = letterFinder(c, list_of_lists_of_letters)
        # if either of the lists have multiple sides or are different from each other continue to next letter
        # and update variables
        if not (len(curr_lists) == 1 and len(prev_lists) == 1 and curr_lists == prev_lists):
            if index + 1 == len(w):
                return w
            prev_lists = curr_lists
            continue
        return


# if regex: capture the last letter of both words, match if captured letter is at start of word 1 or 2
# capture both last letters into separate variables,
# match if l1 is a start of word 2, match if l2 is at start of word 1
# if there are 3 words
# get all first letters
# get all last letters
# we don't want a word matching with itself
# if [0] = /[1] or /[2]
# if [1] = /[0] or /[2]
# if [2] = /[0] or /[1]
def is_valid_chain(word_combination):
    # generate permutations for 2 word combinations
    if len(word_combination) == 2:
        for perm in itertools.permutations(word_combination):
            w1, w2 = perm
            if w1[-1] == w2[0]:
                return perm
    # Generate all permutations of the three words
    else:
        for perm in itertools.permutations(word_combination):
            w1, w2, w3 = perm
            if w1[-1] == w2[0] and w2[-1] == w3[0]:
                return perm
    return None


